css:
@font-face {
  font-family: 'symbol-icons';
  src: url('atom://symbols-tree-view/icons/symbol-icons.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}
.symbols-tree-view {
  width: 200px;
  height: 100%;
  padding: 4px;
  position: relative;
  overflow-y: auto;
  overflow-x: hidden;
}
.symbols-context-menu {
  position: absolute;
  z-index: 1;
  width: 120px;
}
.symbols-context-menu .hidden-input {
  position: absolute;
  width: 0;
  height: 0;
  border: none;
}
.symbols-context-menu .select-list.popover-list {
  width: 100%;
  min-width: 100%;
}
.symbols-context-menu .select-list.popover-list ol {
  margin-top: 0;
}
.symbols-context-menu .select-list.popover-list ol .separator {
  background: #31363f;
  height: 1px;
}
.symbols-context-menu .select-list.popover-list ol li:hover {
  background: #31363f;
}
.symbols-tree-view .icon-function::before {
  font-family: 'symbol-icons';
  content: '\e608';
}
.symbols-tree-view .icon-class::before {
  font-family: 'symbol-icons';
  content: '\e600';
}
.symbols-tree-view .icon-namespace::before {
  font-family: 'symbol-icons';
  content: '\e609';
}
.symbols-tree-view .icon-struct::before {
  font-family: 'symbol-icons';
  content: '\e601';
}
.symbols-tree-view .icon-variable::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.symbols-tree-view .icon-method::before {
  font-family: 'symbol-icons';
  content: '\e608';
}
.symbols-tree-view .icon-field::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.symbols-tree-view .icon-member::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.symbols-tree-view .icon-interface::before {
  font-family: 'symbol-icons';
  content: '\e605';
}
.symbols-tree-view .icon-enum::before {
  font-family: 'symbol-icons';
  content: '\e606';
}
.symbols-tree-view .icon-typedef::before {
  font-family: 'symbol-icons';
  content: '\e603';
}
.symbols-tree-view .icon-macro::before {
  font-family: 'symbol-icons';
  content: '\e602';
}
.symbols-tree-view .icon-union::before {
  font-family: 'symbol-icons';
  content: '\e604';
}
